package com.epocal.common.am;

import com.epocal.common.types.am.*;

/**
 * This class is a mirror of struct HumidityStruct defined in globals.h
 * to be compatible with Analytical Manager C++.
 * DO NOT EDIT THIS FILE without consulting with AM-C++ team first!
 */
public class HumidityStruct {
    public Sensors sensorType;
    public int windowStart;
    public int windowSize;
    public double low;
    public double high;
    public double extra1;
    public double extra2;
    public double extra3;
    public double extra4;
    public double extra5;
    public double extra6;
    public double extra7;
    public double extra8;
    public double extra9;
    public double extra10;

    public HumidityStruct() {
        this.sensorType = Sensors.ENUM_UNINITIALIZED;
    }

    @Override
    public String toString() {
        return "HumidityStruct{" +
                "sensorType=" + sensorType +
                ", windowStart=" + windowStart +
                ", windowSize=" + windowSize +
                ", low=" + low +
                ", high=" + high +
                ", extra1=" + extra1 +
                ", extra2=" + extra2 +
                ", extra3=" + extra3 +
                ", extra4=" + extra4 +
                ", extra5=" + extra5 +
                ", extra6=" + extra6 +
                ", extra7=" + extra7 +
                ", extra8=" + extra8 +
                ", extra9=" + extra9 +
                ", extra10=" + extra10 +
                '}';
    }
}